    <?php #первоначальная загрузка данных из БД
    echo '<script>';
      $dialogList = array();
      $smsList = array();
      $query = "SELECT * FROM tempmessage WHERE token='".$token."'";
      $answer = mysqli_query($link, $query);
      while ($row = mysqli_fetch_array($answer))  {
        $body = str_replace(array("\r","\n", "\""),"", $row["body"]);
        $sms = new Sms($row["name"], $row["address"], $body, (int) $row["date"], $row["type"]);
        $smsList[] = $sms;
      }
      function findDialog($list, $address) {
        for ($i=0; $i < count($list); $i++) {
          if (getShortFormat($list[$i]->address) == getShortFormat($address))
            return $i;
          if ($list[$i]->address == $address)
            return $i;
          }
        return -1;
      }

      function addMessage($list, $sms) {
        $index = findDialog($list, $sms->address);
        if ($index == -1) {
            $dialog = new Dialog($sms->address, $sms->name);
            $list[] = $dialog;
            $index = count($list) - 1;
        }
        $list[$index]->addSms($sms);
        return $list;
      }

      foreach ($smsList as $elem) {
        $dialogList = addMessage($dialogList, $elem);
      }

      echo 'var dialogsList = [];';
      foreach ($dialogList as $dialog) {
        echo 'var dialogTmp = new Dialog("'.$dialog->address.'", "'.$dialog->name.'");';
        //last date and body
        echo 'dialogTmp.lastDate = '.$dialog->lastDate.';';
        echo 'dialogTmp.lastBody = "'.$dialog->lastBody.'";';

        foreach ($dialog->messages as $sms) {
          echo 'var tmp = new Sms( "'.$sms->name.'", "'.$sms->address.'","'.$sms->body.'", '.$sms->date.', "'.$sms->type.'" );';
          echo 'dialogTmp.messages.push( tmp );';
        }
        echo 'dialogsList.push(dialogTmp);';
      }

      echo '</script>';

      $query = "DELETE FROM tempmessage WHERE token='".$token."'";
      mysqli_query($link, $query);
    ?>

    <script>

     //проверка новых сообщений
     setInterval(function() {
       document.getElementsByTagName('iframe')[0].contentWindow.location.href = "dialogs.php?action=getNewSms&token="+token;
       var tmparray = document.getElementsByTagName('iframe')[0].contentWindow.array;
       for (var i = 0; i<tmparray.length; i++) {
        dialogsList = addNewSms(dialogsList, tmparray[i]);
       }
     }, 5000);

     </script>



